INSERT INTO `habitats` (`Habitat_Id`, `Nom`, `Img`, `Desc`) VALUES
(1, 'Savane', , 'Les savannes sont des écosystèmes de prairies tropicales et subtropicales caractérisées par des arbres épars et une vaste couverture herbacée. Elles se trouvent principalement dans les régions tropicales et subtropicales d\'Afrique, d\'Amérique du Sud, d\'Inde et d\'Australie.');
INSERT INTO `habitats` (`Habitat_Id`, `Nom`, `Img`, `Desc`) VALUES
(2, 'Marais', , 'Les marais sont des zones humides où l\'eau stagnante ou à faible écoulement est présente en permanence ou de manière saisonnière. Ils peuvent se former dans les zones où le sol est saturé d\'eau, que ce soit par des précipitations abondantes, des inondations régulières ou des niveaux de nappe phréatique élevés.');
INSERT INTO `habitats` (`Habitat_Id`, `Nom`, `Img`, `Desc`) VALUES
(4, 'Jungle', , 'La jungle est un terme souvent utilisé pour décrire les forêts tropicales denses, où la végétation est extrêmement luxuriante et diversifiée. Ces forêts se trouvent principalement autour de l\'équateur, en Amérique du Sud, en Afrique, en Asie du Sud-Est et dans certaines îles du Pacifique.');
INSERT INTO `habitats` (`Habitat_Id`, `Nom`, `Img`, `Desc`) VALUES
(5, 'Artic', , 'L\'Arctique est une région polaire située au nord de la Terre, caractérisée par des températures extrêmement basses, des glaces permanentes et une saison estivale courte et fraîche.');

